import React from 'react';

class Menu extends React.Component {
    
    render() {
        return (
            <>
                <ul>
                    {this.props.list.map(item=> (
                    <li key={item.id}>{item.title}</li>
                    ))}
                </ul>
            </>
        );
    }
}

export default Menu;
